import Projects from './components/Projects.jsx'
import styled from 'styled-components';
import Page3New from './components/page3New.jsx'
import Nav from './components/Nav.jsx'
import Social from './components/Social.jsx'
import Gallery1 from './components/Gallery.jsx'
import TimeLine from './components/TimeLine.jsx'

import Footer from './components/footer.jsx'
import Contact from './components/contact.jsx'
import { ObjectivesProvider } from './context/Objectives';

const Stats = styled.div`
cursor: pointer;
    fill:#125eac ;
    padding: 10px;
    color: #e4e4e4;
    height: 50px;
    width: 50px;
    background: #eec100;
    border-radius: 5px 0px 0px 5px;

    border-right: 0px;
`

const StatsHeading = styled.div`
padding: 10px 20px;
    padding-bottom: 0px;
    color: #e4e4e4;
    font-family: 'Pixel';
    font-size: 28px;
`
const Check = styled.div`
width:30px;
fill: gray;
`
const CheckComplete = styled.div`
width:30px;
fill: #00d400;
`

const Ach = styled.div`
padding: 15px;
background: #20273b;
margin: 15px;
color: #e4e4e4;
border-radius: 5px;
display: flex;
justify-content: space-between;
align-items: center;

`
const StatsMenu = styled.div`

background: #125eac;

padding: 0px;
width: 300px;
border-radius: 0px 0px 0px 10px;
`
const StatsMenuHolder = styled.div`
position: fixed;
top: 198px;
right: 0px;
display: flex;
z-index: 99;
transform: translateX(${props => props.statMenu}px);
transition: 0.5s all linear;
`
function App() {



  return (
    <div  >
       <ObjectivesProvider>
        {/* <Nav/> */}

        <Page3New />

        <Gallery1/>

        {/* <TimeLine/> */}
        <Contact/>

        <Footer/>
       </ObjectivesProvider>
    </div>
  );
}

export default App;
